window.bookSummaryJSON = "<p><i>“I never miss.”</i></p> <p>Riot Night changed my life. Coming back to Shadow Grove turned it on its head.</p> <p>I’ve been hunted, stabbed, stalked, tormented, and used. Hate fueled me, lies tore me apart, and in the end, everything I thought I knew turned out to be fake.</p> <p>Except...Riot Night also brought Archer, Kody, and Steele back into my life. No matter how much I’ve fought it, hated it, been lied to, or discovered the deceptions - I want them in my life.</p> <p>No one owns me.</p> <p>No one is taking them away.</p> <p>This is my life, dammit, and these guys are mine to keep.</p> <p>If a war is what it takes, then a war is what they’ll get.</p>"; 
